<!DOCTYPE html>

<head>
    <title>Election Results Template</title>
    <meta charset="UTF-8">

    <script src="https://code.jquery.com/jquery-3.2.1.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/handlebars.js/4.7.6/handlebars.min.js"></script>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Abel&display=swap');

    body {
        margin: 10% 0 0 10%;
    }

    .race-title {
        font-family: Helvetica, sans-serif;
        font-size: 8px;
        font-weight: bold;
        display: block;
        /*border-top: 1px solid #1a1a1a;*/
        margin-top: 5px;
        margin-bottom: 0;
        /*padding-top: 2px;*/
        background-color: #1a1a1a;
        color: #fff;
        padding: 3px;
        text-transform: uppercase;
        text-align: center;
    }

    .district-title {
        font-family: Helvetica, sans-serif;
        font-size: 8px;
        font-weight: bold;
        display: block;
        border-top: 1px solid #1a1a1a;
        margin-top: 3px;
        padding-top: 1px;
        color: purple;
    }

    #col-1 {
        /*width: 9px;*/
        width: 8.3%;
        margin-right: 1px;
    }

    #col-2 {
        /*width: 8px;*/
        width: 7.4%;
        /*margin-right: 2px;*/
    }

    #col-3 {
        /*width: 89px;*/
        width: 82.4%;
        /*margin-right: 2px;*/
        font-family: 'Abel';
        font-size: 8px;
    }

    #col-4 {
        /*width: 24px;*/
        /*width: 22.2%;*/
        float: right;
        text-align: right;
        font-family: 'Abel';
        font-size: 8px;
        color: orange;
    }

    #container {
        width: 108px;
        font-size: 8px;
    }
</style>
</head>

<body>
    <div id="displayArea"></div>
    <!-- <script id="myTemplate" type="text/x-handlebars-template">
        {{#each results}}
        <h1>Employee Name : {{this.name}}, Age : {{this.age}}</h1>
        {{/each}} -->
    <script id="myTemplate" type="text/x-handlebars-template">
        <div id="container">
            {{#each results}}
                {{#if officename}}
                    <span class="race-title">{{this.officename}}</span>
                {{/if}}
                {{#if seatname}}
                    <div class="district-title">{{this.seatname}}</div>
                {{/if}}
            <div id="container">
                {{#if winner}}
                    <span id="col-1">&#10004;</span>
                {{else}}
                    <span id="col-1">&nbsp;&nbsp;&nbsp;</span>
                {{/if}}
                {{#ifEquals party "Dem"}}
                    <div id="col-2" style="width:6px;height:6px;background-color:#009ac9;margin-top:2px;display:inline-block"></div>
                {{/ifEquals}}
                {{#ifEquals party "GOP"}}
                    <div id="col-2" style="width:6px;height:6px;background-color:#f04e41;margin-top:2px;display:inline-block"></div>
                {{/ifEquals}}
                {{#ifEquals party "Lib"}}
                    <div id="col-2" style="width:6px;height:6px;background-color:#faa61a;margin-top:2px;display:inline-block"></div>
                {{/ifEquals}}
                {{#ifEquals party "Una"}}
                    <div id="col-2" style="width:6px;height:6px;background-color:#a7a9ac;margin-top:2px;display:inline-block"></div>
                {{/ifEquals}}
                {{#ifEquals party "Uty"}}
                    <div id="col-2" style="width:6px;height:6px;background-color:#c48fc0;margin-top:2px;display:inline-block"></div>
                {{/ifEquals}}
                {{#ifEquals party "NP"}}
                {{/ifEquals}}
                {{#ifEquals party "Yes"}}
                    <div id="col-2" style="width:6px;height:6px;background-color:#D0F78F;margin-top:2px;display:inline-block"></div>
                {{/ifEquals}}
                {{#ifEquals party "No"}}
                    <div id="col-2" style="width:6px;height:6px;background-color:#f8a891;margin-top:2px;display:inline-block"></div>
                {{/ifEquals}}
                <span id="col-3">{{this.firstname}} {{this.lastname}}</span>
                <span id="col-4">{{this.votepercent}}</span>
            </div>
            {{/each}}
        </div>
    </script>

    var tmpHtml = document.getElementById("myTemplate").innerHTML;
    var template = Handlebars.compile(tmpHtml);
    Handlebars.registerHelper('ifEquals', function(arg1, arg2, options) {
        return (arg1 == arg2) ? options.fn(this) : options.inverse(this);
    });
